import { Dispatch, SetStateAction, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { Timer, StartButton, Box, Container, MoveOn } from "./Common";
import Header from "./Header";
import SummaryPrompt from "./SummaryPrompt";
import { Question, Station } from "./types";

type SummaryProps = {
    station: Station;
    updateStation: Dispatch<SetStateAction<Station>>;
    handleExit: (questions: Question[], tok: string) => void;
};

const Summary = (props: SummaryProps) => {
    return (
        <Container>
            <Header
                timedHeader={false}
                percentage={100}
                briefPrompt={props.station.brief.prompt}
                title={"Station One"}
                station={props.station}
                updateStation={props.updateStation}
                handleExit={props.handleExit}
            />

            <br></br>

            <Box style={{ textAlign: "center" }}>
                <SummaryPrompt />

                <br />

                <Link to="/OSCE/Station/Review0">
                    <Start>Start Review</Start>
                </Link>
            </Box>
        </Container>
    );
};

export default Summary;

const Start = styled.div`
    background-color: grey;
    border: 2px solid grey;
    border-radius: 5px;
    margin: 0 auto;
    padding: 1% 0;
    &:hover {
        cursor: pointer;
        border: 2px solid #fad000;
        color: #fad000;
    }
`;
